import LoginForm from "../components/LoginForm/LoginForm";
import Footer from "../components/Footer/Footer";
const Landing = () => {

    return (
        <div className="containerLanding">
            <h1 className="h1landing">Games App</h1>
            <LoginForm />
            <div>
                <Footer />
            </div>
        </div>
    )
}

export default Landing
